    public static boolean hasField(Object obj, String name) {
        if (obj == null) {
            return false;
        }

        HashSet hs = PARAMETERS_LOOKUP.get(obj.getClass());

        if (hs == null) {
            return false;
        }

        return hs.contains(name);
    }

    public static Object getFieldRawValue(Object obj, String name) {
        try {
            Field f;
            Class oc = obj.getClass();

            while (true) {
                try {
                    f = oc.getDeclaredField(name);
                    break;
                } catch (Exception e) {
                    if ((oc = oc.getSuperclass()) == null) {
                        return null;
                    }
                }
            }

            f.setAccessible(true);
            Object v = f.get(obj);

            if (v == null) {
                return null;
            }

            Class cls = v.getClass();

            while (true) {
                if (cls == null || cls == RootInterface.class) {
                    break;
                }

                if (cls == STRING.class) {
                    return ((STRING) v).getDecodedValue();
                }

                if (cls == DOUBLE.class) {
                    return ((DOUBLE) v).value;
                }

                if (cls == INTEGER.class) {
                    return ((INTEGER) v).value;
                }

                if (cls == BOOLEAN.class) {
                    return ((BOOLEAN) v).value;
                }

                if (cls == LOGICAL.class) {
                    return ((LOGICAL) v).value;
                }

                if (cls == ENUM.class) {
                    return ((ENUM) v).value.name();
                }

                if (cls == SET.class) {
                    return ((SET) v).toArray();
                }

                if (cls == LIST.class) {
                    return ((LIST) v).toArray();
                }

                cls = cls.getSuperclass();
            }

            return v;
        } catch (Exception ex) {
            // Shouldn't happen
            return null;
        }
    }
